import React from 'react';
import styles from './Navbar.module.css';

const Navbar = (props) => {
  console.log(props);
  return (
    <nav className={styles.nav}>
      {props.navigation.map((item) => (
        <div className={styles.item}>
          <a>{item}</a>
        </div>
      ))}
    </nav>
  );
};
export default Navbar;
